import axios from 'axios'

const url="http://localhost:8080"

export const inserting=async(obj)=>{
    alert("Before to back end "+JSON.stringify(obj))
    const t=axios.post(`${url}/add`,obj)
    alert("Before to back end "+JSON.stringify(obj))
    return t;
}

//export {inserting}
